import './App.css';
import HelloWorld from './HelloWorld';
import Greeting from './Greeting';


function Product (props) {
  return (
    <div>
      <h2>{props.name_product}</h2>
      <p>{props.price_product}</p>
    </div>
  );
}

function App() {
  return (
    <div>
      <HelloWorld />
      <Greeting name="john"/>
      <Product name_product="Keyboard" price_product="$50" />
    </div>
  );
}

export default App;
